import React,{Component} from 'react';
import {Nav,NavDropdown,Navbar,FormGroup,Form,FormControl,Button, NavItem, NavLink} from 'react-bootstrap';
import {Link} from "react-router-dom";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import '../../node_modules/font-awesome/css/font-awesome.min.css';
import "../css/"
export default class NavBar extends Component{
    
constructor(props){
    super(props);
    this.state={
        username:""
    }

}
render()
{
return(
  <>
    <Navbar className="bg-img" style={{background:"none", marginLeft:"20px",marginRight:"20px",marginBottom:"15px",marginTop:"15px"}} bg="transparent" expand="lg" >
        <Navbar.Brand style={{marginLeft:"100px",fontSize:"30px"}}><Link style={{textDecoration:"none",color:"black"}} to="/"><i style={{padding:"10px"}} className="fa fa-cube"/>AddJency</Link></Navbar.Brand>
        {/* <Navbar.Toggle aria-controls="basic-navbar-nav" /> */}
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
          </NavDropdown> */}
        </Nav>
        <Form inline style={{marginRight:"35px"}}>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <i className="fa fa-search"/>
        </Form>
        <NavLink><Link style={{textDecoration:"none",fontSize:"20px",color: "black"}} to="/signin">Sign In</Link></NavLink>
          <NavLink><Link style={{textDecoration:"none",fontSize:"20px",color: "black",marginRight:"50px"}} to="/signup">Sign Up</Link></NavLink>
        </Navbar.Collapse>
    </Navbar>
    </>
    );
}
}
